<script>
import { Form, HasError, AlertError } from "vform";
export default {
  data()  {
    return {
      showModal: false,
      CustomizeModal: false,
      image: '',
      form: new Form({
        name: "",
        description: "",
        startingtime: "",
        endingtime: "",
        private: '0',
        team: '0',
        time: '0',
        conditions: '',
        prize: '',
        profile: 'data:image/jpeg;base64,',
        logo: 'data:image/jpeg;base64,',

      }),

    }
  },
  methods:{
      updateLogo(e){
                let file = e.target.files[0];
                let reader = new FileReader();
                let limit = 1024 * 1024 * 2;
                if(file['size'] > limit){
                   toast.fire({
                        type: 'error',
                        title: 'Oops...',
                        text: 'You are uploading a large file',
                    })
                    return false;
                }
                reader.onloadend = (file) => {
                    this.form.logo = reader.result;
                }
                reader.readAsDataURL(file);
            },
            updateProfile(e){
                let file = e.target.files[0];
                let reader = new FileReader();
                let limit = 1024 * 1024 * 2;
                if(file['size'] > limit){
                   toast.fire({
                        type: 'error',
                        title: 'Oops...',
                        text: 'You are uploading a large file',
                    })
                    return false;
                }
                reader.onloadend = (file) => {
                    this.form.profile = reader.result;
                }
                reader.readAsDataURL(file);
            },

            clearCustomiz(){
this.form.conditions= '';
        this.form.prize = '';
        this.form.profile = 'data:image/jpeg;base64,';
this.CustomizeModal =false;
            },





            async creatcontest() {
      const response = await this.form
        .post("/controlpanel/contests/creat" )
        .then(({ data }) => {

            if (data.status == 200) {
            this.showModal = false;
            toast.fire({
              icon: "success",
              title: data.description,
              showConfirmButton: false,
              timer: 3000,
            });

          } else {
            toast.fire({
              icon: "error",
              title: "Oops...",
              text: data.description,
            });
          }

        })
.catch(error => {
    toast.fire({
              icon: "error",
              title: "Oops...",
              text: 'Something went wrong!!',
            });
});

      // ...
    },

  }
